import { Outlet } from "react-router-dom";
import { SidebarLeft, SidebarRight } from "../../components";

const Public = () => {
  return (
    <div className="w-full flex">
      <div className="grid grid-cols-4">
        <SidebarLeft/>
      </div>
      <div className="grid grid-cols-6 ">
        Public
        <Outlet />
      </div>
      <div className="grid">
        <SidebarRight/>
      </div>
    </div>
  );
};

export default Public;
